import request from '@/utils/request';
export default {
  add: function add(idGoods) {
    return request({
      url: '/user/favorite/add/' + idGoods,
      method: 'POST'
    });
  },
  dislike: function dislike(idGoods) {
    return request({
      url: '/user/favorite/dislike/' + idGoods,
      method: 'POST'
    });
  },
  dislikeBatch: function dislikeBatch(params) {
    return request({
      url: '/user/favorite/dislikeBatch',
      method: 'POST',
      data: params
    });
  },
  ifLike: function ifLike(idGoods) {
    return request({
      url: '/user/favorite/ifLike/' + idGoods,
      method: 'GET'
    });
  },
  list: function list() {
    return request({
      url: '/user/favorite/list',
      method: 'GET'
    });
  }
};
